module.exports = "#reportCanvas{\r\n    max-width: 800px;\r\n    max-height: 500px;\r\n    border: solid 1px black;\r\n    margin: 25px;\r\n    background-color: rgba(108, 146, 159, 0.1);\r\n    font: black;\r\n}\r\n#sideMenu{\r\n    max-width: 300px ;\r\n    min-width: 300px ;\r\n    margin-bottom: 10px;\r\n}\r\n#tableHead {\r\n    color: #fff;\r\n    background-color: #35597D;\r\n}\r\n#tableName{\r\n    color: #fff;\r\n    background-color:rgb(2, 40, 53);\r\n}\r\n#sideBard{\r\n    background-color: #424242;\r\n}\r\n/* switch */\r\n/* The switch - the box around the slider */\r\n.switch {\r\n    position: relative;\r\n    display: inline-block;\r\n    width: 60px;\r\n    height: 34px;\r\n  }\r\n/* Hide default HTML checkbox */\r\n.switch input {display:none;}\r\n/* The slider */\r\n.slider {\r\n    position: absolute;\r\n    cursor: pointer;\r\n    top: 0;\r\n    left: 0;\r\n    right: 0;\r\n    bottom: 0;\r\n    background-color: #ccc;\r\n    -webkit-transition: .4s;\r\n    transition: .4s;\r\n  }\r\n.slider:before {\r\n    position: absolute;\r\n    content: \"\";\r\n    height: 26px;\r\n    width: 26px;\r\n    left: 4px;\r\n    bottom: 4px;\r\n    background-color: white;\r\n    -webkit-transition: .4s;\r\n    transition: .4s;\r\n  }\r\ninput:checked + .slider {\r\n    background-color: #2196F3;\r\n  }\r\ninput:focus + .slider {\r\n    -webkit-box-shadow: 0 0 1px #2196F3;\r\n            box-shadow: 0 0 1px #2196F3;\r\n  }\r\ninput:checked + .slider:before {\r\n    -webkit-transform: translateX(26px);\r\n    transform: translateX(26px);\r\n  }\r\n/* Rounded sliders */\r\n.slider.round {\r\n    border-radius: 34px;\r\n  }\r\n.slider.round:before {\r\n    border-radius: 50%;\r\n  }"

